import React from "react";


class Order extends React.Component {

    OrderIds = Object.keys(this.props.order);

    render() {
        return(
            <div className='order-wrap'>
                <h2>Ваше замовлення</h2>
                <ul className='order'>
                    {this.OrderIds.map(key => {
                        return <li>{key}</li>;
                    })}
                </ul>
            </div>
        )
    }
}

export default Order;
